import React, { Component } from 'react';
import "../styles/name.css"

class Name extends Component {
    render() {
        return (
            <div className="name">
                <span class="logo firstName">Sliding</span>
                <span class="logo lastName">Logo</span>

            </div>
        );
    }
}

export default Name;
